// eslint-disable-next-line no-inner-declarations
export function getIcon(icon: string, color: string) {
  if (icon === 'coal') return svgCoal(color);
  else if (icon === 'house') return svgHouse(color);
  else if (icon === 'propane') return svgPropane(color);
  else if (icon === 'smartphone') return svgSmartphone(color);
  else if (icon === 'trash') return svgTrash(color);
  else if (icon === 'windmill') return svgWindmill(color);
  else if (icon === 'ledlamp') return svgLed(color);
  else if (icon === 'tree') return svgTree(color);
  else if (icon === 'forest') return svgForest(color);
  else if (icon === 'car') return svgCar(color);
  else return svgHouse(color);
}
